import React from 'react'
import ProductCard from './ProductCard'

export default function ProductList({products, logo, title, price}) {

  return (
    <div>
      <h1>PRODUCT LIST</h1>

      <ProductCard logo={logo} title={title} price={price} />
    </div>
  )
}
